/* eslint-disable react/style-prop-object */
import React, { Component } from 'react';
import Base from 'terra-base';
import Hyperlink from 'terra-hyperlink'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">

          <Base>
          <Hyperlink href="#green">Default hyperlink</Hyperlink>
          <Hyperlink href="https://www.cerner.com" variant="external">External hyperlink</Hyperlink>;
          <div style="height:800px;width:400px;color:red;" id="red"></div>
          <div style="height:800px;width:400px;color:blue;" id="blue"></div>
          <div style="height:800px;width:400px;color:green;" id="green"></div>
          </Base>
        </header>
      </div>
    );
  }
}

export default App;
